paragraphs.text:
call gds.graph.create(
    'myGraph',
    {
        DNode: {
        label: 'Dnode',
        properties: ['wNum','determined']
    }
    },{
        zMap: {
        type: 'zMap',
        orientation: 'UNDIRECTED'    
        }
    }
    )

CALL gds.alpha.ml.splitRelationships.mutate('myGraph', {
  relationshipTypes: ['zMap'],
  remainingRelationshipType: 'zMap_REMAINING',
  holdoutRelationshipType: 'zMap_TESTGRAPH',
  holdoutFraction: 0.2
}) YIELD relationshipsWritten

CALL gds.alpha.ml.splitRelationships.mutate('myGraph', {
  relationshipTypes: ['zMap_REMAINING'],
  remainingRelationshipType: 'zMap_IGNORED_FOR_TRAINING',
  holdoutRelationshipType: 'zMap_TRAINGRAPH',
  holdoutFraction: 0.2
}) YIELD relationshipsWritten
